const totals={'First Year':{'1st Semester':{'lecture':3,'lab':3,'credit_units':6}},'Fourth Year':{'3rd Semester':{'lecture':1,'lab':1,'credit_units':2}}};document.addEventListener("DOMContentLoaded",function(){for(const[year,semesters]of Object.entries(totals)){for(const[semester,details]of Object.entries(semesters)){document.getElementById(`lecture-${year}-${semester}`).innerText=details.lecture;document.getElementById(`lab-${year}-${semester}`).innerText=details.lab;document.getElementById(`credit_units-${year}-${semester}`).innerText=details.credit_units;}}});;